import { Routes, Route, BrowserRouter } from "react-router-dom";
import Login from "../login/Login";
function LoginRoutes() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Login />} />
      </Routes>
    </BrowserRouter>
  );
}

export default LoginRoutes;
